  [],\n\t\"revision_timestamp\": \"2015-05-06T21:58:20.420148\",\n\t\"name\": \"3d-visualization-system-for-tracking-and-identification-of-objects-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Photon-X has developed a proprietary EO
  spatial phase technology that can passively collect 3-D images in real-time using
  a single camera-based system. This technique provides the capability to sense and
  understand objects and features within a range of distances from low atmospheric
  altitudes to space. Feedback from the camera allows the Photon-X system to perform
  3-D path planning and trajectory assessment for multiple objects of various sizes
  and shapes. Spatial phase technology provides scene date that is range independent
  and angle invariant allowing data of tumbling objects to be collected even in the
  presence of smoke, clouds, or haze. During Phase I, Photon-X plans to model 3D views
  of tumbling objects and develop preliminary feature extraction and predictive trajectory
  and range software tools. These tools will be used to demonstrate proof-of-concept
  for a single controlled scenario. This initial groundwork will be used in selecting
  the best design approach for Phase II to meet established system goals. A Phase
  II system will build on the concepts shown in the Phase I proof-of-concept demonstration.
  A Phase II system will collect image data and track an object in real-time with
  collected data stored and processed later for feature extraction and 3D modeling.\",\n\t\"license_title\":
